      SELECT DISTINCT + + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + 95 * - - col2 AND + + CAST ( + + col0 AS INTEGER );
  - name: tab2

outputs:
  - name: q10055.out
    data: |
